import React, { Component } from "react";
import './'

class Counter extends Component {
   state = {
      count: 0,
   };
   render() {
      // const a = "lalit";

      return (
         <div className="container">
            {/* <h3>{a}</h3> */}
            <h3>{this.state.count}</h3>
            <button
               className="cntbtn"
               onClick={() => this.setState({ count: this.state.count + 1 })}
            >
               Update
            </button>
         </div>
      );
   }
}

export default Counter;
